import './App.css';
import Navbar from './Layout/navbar/Navbar';
import Home from './page/home/Home';
import MyList from './page/mylist/MyList';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Home></Home>
      <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/mylist" component={MyList} />
      </Switch>
    </Router>
    </div>

  );
}

export default App;
